import './navbar.css';
import Button from '@mui/material/Button';

function Footer() {
  return (
    <>
      <nav>
        <div className="navCont">
            <Button variant="text" id="contact" className="nav-p" sx = {{color : "#fff"}}>Contact</Button>
            <Button variant="text" id="resume"  className="nav-p" sx = {{color : "#fff"}}>Resume</Button>
        </div>
      </nav>
    </>
  )
}

export default Footer;
